     name: 'Phet', dates: [2010], type: 'cyclone', area: 'Northern Indian'
   },
   {
     name: 'Eleanor', dates: [2018], type: 'storm', area: 'Atlantic'
   }
]

const Search = (props) => {
     return(
          <div className='AppInput'>
               <Label>Search for a meal...</Label>
               <input type="text" placeholder='Lasagnia' 
               value= {props.input} onChange={props.handleInput}/>

          </div>
     )
}

export default Search;



